    `id` VARCHAR(18) CHARACTER SET utf8,
    `name` VARCHAR(116) CHARACTER SET utf8,
    `path_id` VARCHAR(18) CHARACTER SET utf8,
    `path_name` VARCHAR(116) CHARACTER SET utf8,
    `subCategories_id` VARCHAR(18) CHARACTER SET utf8,
    `subCategories_name` VARCHAR(116) CHARACTER SET utf8
);
